/*Table structure for table `data_client` */

DROP TABLE IF EXISTS `data_client`;

CREATE TABLE `data_client` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `module_id` int(11) unsigned NOT NULL,
  `ie_name` varchar(255) DEFAULT NULL,
  `data` text CHARACTER SET latin1 NOT NULL,
  `status` tinyint(1) DEFAULT '0' COMMENT '0 - not been sent, 1 - sent; 3 - client confirm ok; 4 - connection error',
  `created_at` timestamp NULL DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `module_id` (`module_id`),
  KEY `created_by` (`created_by`),
  CONSTRAINT `data_client_ibfk_1` FOREIGN KEY (`module_id`) REFERENCES `modules` (`id`) ON DELETE CASCADE,
  CONSTRAINT `data_client_ibfk_2` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`)
